content.css:
.yAxis path,
.yAxis line,
.xAxis path,
.xAxis line {
  fill: none;
  stroke: #000;
  stroke-width: 1px;
}
.rotateLeft {
  vertical-align: middle;
  text-align: center;
}
div.sandbox-host {
  width: 100%;
  height: 100%;
}
td span {
  -ms-writing-mode: tb-rl;
  -webkit-writing-mode: vertical-rl;
  writing-mode: vertical-rl;
  transform: rotate(180deg);
  white-space: nowrap;
}
tr.layoutRow {
  height: 0;
}
td.chartArea {
  height: 100%;
}
#masterDiv {
  display: flex;
  justify-content: space-around;
  align-items: center;
}
#masterDiv table {
  border-spacing: 0px;
}
.chartLabel {
  text-align: center;
  width: 100%;
  height: 0;
}
.yLabel {
  width: 0;
  height: 0;
  white-space: no-wrap;
}
.xLabel {
  width: 100%;
  text-align: center;
}
.datapoint,
.variancepoint {
  fill: #000000;
  stroke: none;
}
.ooc-1,
.ooc-2,
.ooc-3,
.ooc-4,
.ooc-5,
.ooc-6 {
  fill: red;
}
.datapoint.selected {
  stroke: black;
  fill: blue !important;
}
div.nodata {
  margin: auto;
  width: 50%;
  font-size: 22vmin;
  text-align: center;
  color: grey;
  position: relative;
  top: 50%;
  -webkit-transform: translateY(-50%);
  -ms-transform: translateY(-50%);
  transform: translateY(-50%);
}
div.stControlChartHeader,
div.stControlChartChannel,
div.stControlChartMainhelp,
div.stControlChartSupport {
  text-align: left;
  width: 500px;
  margin: auto;
  font-family: Georgia, Times, Times New Roman, serif;
}
div.stControlChartHeader > h2 {
  text-align: center;
}
div.stControlChartHeader > .byline {
  text-align: center;
}
div.stControlChartMainhelp > .options {
  font-style: italic;
}
#stControlChartIcon {
  display: block;
  width: 200px;
  height: 200px;
  margin-left: auto;
  margin-right: auto;
  background-image: url('data:image/jpeg;base64,');
}


